CREATE TABLE IF NOT EXISTS product (
    id BIGINT AUTO_INCREMENT PRIMARY KEY,
    model VARCHAR(255),
    name VARCHAR(255),
    price DECIMAL(10, 2),
    about TEXT,
    image TEXT,
    type VARCHAR(255)
);

